@FewArePict It does point, when you pull it apart, to one of the main reasons for homophobia. IMHO. Specifically,
1. Sexuality's not a light switch, it's a spectrum.
2. As with most spectra, most people are somewhere in the middle, not at the extremes (in other words, it's a bell curve).
